actionConfiguration.body:
()=>{
		GetGSheetContent_VesselBehav.run(
			//success
			() => {
				let array_payload=[];		
				let APIdata = [];
				APIdata = GetGSheetContent_VesselBehav.data.values;
				for (let i=1;i<APIdata.length;i++){
					array_payload.push({
						"vesselId": APIdata[i][0],
						"behaviour": APIdata[i][1],
						"start": ((APIdata[i][2]==null||APIdata[i][2]=="")?null:APIdata[i][2]),
						"end": ((APIdata[i][3]==null||APIdata[i][3]=="")?null:APIdata[i][3])
					})						
				}
				storeValue("Key_VB_ArrayPayload", array_payload);
			},
			//fail
			() => {showAlert("Something went wrong - Can't get data from GSheet")}			
		)
	}

